export const getStandardVFS = () => {
  const target = {
    data: '',
    encoding: 'base64',
  }

  return {
    vfs: {
      'Roboto-Regular.ttf': target,
      'Roboto-Medium.ttf': target,
      'Roboto-Italic.ttf': target,
      'Roboto-MediumItalic.ttf': target,
    },
    fonts: {
      Roboto: {
        normal: 'Roboto-Regular.ttf',
        bold: 'Roboto-Medium.ttf',
        italics: 'Roboto-Italic.ttf',
        bolditalics: 'Roboto-MediumItalic.ttf',
      },
    },
  }
}
